import Navbar from  './Components/Navbar'
import './App.css';
import News from './Components/News';


import { BrowserRouter as Router, Route, Link, Switch} 
        from "react-router-dom";

function App() {
  return (
    <>
      <Router>
      <Navbar/>




      <Switch>

          <Route exact path="/" > <News country="in" category ="general"/></Route>
          <Route exact path="/business" > <News country="in" category ="business"/></Route>

        </Switch>

      </Router>

    </>
  );
}

export default App;
